import React, {Component} from "react";
import Background from "../img/Cacao_photo.jpg"

const styles = {
    width : "100%",
    height: "100%",
}
export default class Home extends Component {
    render() {
        return (
            <div className = "container">
                <div className = "home_text">
                    Cacao & Beyond
                    <img src = {Background} style={styles} className="background picture"></img>
                </div>
            </div>
        );
    }
}
